                        "script": "//营销组织投放时\nlet saleareas = Page.getArrayCtrl('TF-参与组织').getAllRows()\nvar saleareasData = []\nvar keys = []\nfor (let item of saleareas) {\n    saleareasData.push({\n        \"key\": item.getCtrl('参与组织-组织id').value,\n        \"text\": item.getCtrl('参与组织-营销组织名称').value,\n        \"id\": item.getCtrl('参与组织-组织id').value,\n        \"parentid\": item.getCtrl('参与组织-组织parentid').value\n    })\n    keys.push(item.getCtrl('参与组织-组织id').value)\n}\n\nPage.setValue('saleareasData', saleareasData)\n\nvar setter = PickerCtrlOptionSetter();\nsetter.append(\"key\", \"key\");\nsetter.append(\"text\", \"text\");\nsetter.append(\"id\", \"id\");\nsetter.append(\"parentid\", \"parentid\");\n\n//如果后续活动设置已根据营销组织选择，须更新原有的下拉选项\nfunction refreshSaleare(prefix) {\n    var tyallRows = Page.getArrayCtrl(prefix+'表格').getAllRows()\n    if (tyallRows != null) {\n        for (var i = 0; i < tyallRows.length; i++) {\n            var row = tyallRows[i]\n            //营销组织控件下拉选项更新\n            row.getPickerCtrl(prefix + '表格营销组织').setOption(saleareasData, setter);\n            //已选营销组织，去除\n            var saleareaid = row.getCtrl(prefix + '表格营销组织').getValue(CtrlValueGetter('key'))\n            if (keys.indexOf(saleareaid) == -1) {\n                row.getCtrl(prefix + '表格营销组织').value = ''\n            }\n        }\n    }\n}\nrefreshSaleare(\"GD-TY-\")\nrefreshSaleare(\"BD-DZ-\")\n"
