                        "script": "//在最后面插入数据\ndebugger\nvar salearea_range = Page.getCtrl('JB-投放范围').value\nvar saleareasData = Page.getValue(\"saleareasData\")\nvar businessData = Page.getValue(\"businessData\")\nvar array = Page.getArrayCtrl('BD-DZ-表格').getAllRows()\nvar num = 0\nif (array.length != 0) {\n    var num = array.length\n}\n\nif (salearea_range) {\n    //构建setter\n    var setter = PickerCtrlOptionSetter();\n    setter.append(\"key\", \"key\");\n    setter.append(\"text\", \"text\");\n    setter.append(\"id\", \"id\");\n    setter.append(\"parentid\", \"parentid\");\n    //设置选项数据\n    if (saleareasData) {\n\n        // Page.getPickerCtrl('客户类型').setOption(data, setter);\n        var result = Page.getArrayCtrl('BD-DZ-表格').append([{}], 'tail', null)\n        if (result == true) {\n            //插入成功\n            var indexes = [num];\n            var rows = Page.getArrayCtrl('BD-DZ-表格').getRowAtIndexes([num]);\n            if (rows != null) {\n                for (var i = 0; i < rows.length; i++) {\n                    var row = rows[i];\n                    //做一些操作，如设置row的下拉选项\n                    row.getPickerCtrl('BD-DZ-表格营销组织').setOption(saleareasData, setter);\n                    if (businessData)\n                        row.getPickerCtrl('BD-DZ-表格业务活动类型').setOption(businessData, setter);\n                    //daterange \n\n                    handelDateRange(row, 'BD-DZ-表格终端执行周期（市场检核）')\n                    handelDateRange(row, 'BD-DZ-表格活动执行周期（变价周期）')\n                }\n\n\n\n                debugger\n\n            }\n            Page.alert('info', '插入成功')\n        }\n    } else {\n\n        Page.alert('info', '【投放范围】投放区域未设置')\n    }\n\n}\nelse {\n\n    Page.alert('info', '【基本信息】投放区域未设置')\n}\n\n\n\n\n\n\nfunction handelDateRange(row, ctrlName) {\n    //日期设置\n    let active_date_range = Page.getCtrl(\"JB-活动时间\")\n\n    let active_date_start = active_date_range.getValue(CtrlValueGetter('start'))\n\n    let active_date_end = active_date_range.getValue(CtrlValueGetter('end'))\n\n    if (!active_date_start || !active_date_start) {\n        Page.alert('info', '请先填写活动日期')\n    }\n\n    let date_range = row.getCtrl(ctrlName)\n\n    date_range.setProperty('min', active_date_start)\n    date_range.setProperty('max', active_date_end)\n\n    // date_range.setValue('start', CtrlValueSetter('end'))\n    // date_range.setProperty('end', CtrlValueSetter('start'))\n\n       date_range.value = JSON.parse(active_date_range.value)\n\n}\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n"
