                        "script": "//获取列表焦点项\n//获取弹窗勾选项\ndebugger\nvar focusRow = Page.getArrayCtrl('BD-DZ-表格').getFocusRow()\nif(focusRow.getCtrl('BD-DZ-表格剔除送达方').value === '1'){\n    if(focusRow.getCtrl('BD-DZ-表格售达方').value == ''){\n        Page.alert('info','请先选择售达方')\n    }else{\n        Page.runEvent('TC-送达方选择') \n        Page.setValue(\"BDDZ送达方选择\",\"2\")\n    }\n    focusRow.getCtrl('BD-DZ-表格剔除送达方').value = ''\n}\nif(focusRow.getCtrl('BD-DZ-表格剔除送达方').value === '3'){\n    focusRow.getCtrl('BD-DZ-表格送达方').readonly = false\n        focusRow.getCtrl('BD-DZ-表格剔除送达方').value = ''\n}"
